import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function Home() {
  return <h1 style={{ color: "green", textAlign: "center" }}>üè† Home Page</h1>;
}

function Login() {
  return <h1 style={{ color: "blue", textAlign: "center" }}>üîë Login Page</h1>;
}

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/login" element={<Login />} />
      </Routes>
    </Router>
  );
}

export default App;
